function isSeedNodeValid(seedNode) {
  if (!seedNode) {
    return false;
  }

  var portParts = seedNode.split(':');
  var parts = portParts[0].split('.');
  var containsInvalidCharacters = parts.some(function (part) {
    var match = part.match(/[A-Za-z0-9\-]*/)[0];
    return match !== part || !part;
  });

  return !containsInvalidCharacters;
}

function isSeedNodePortValid(seedNode) {
  if (!seedNode) {
    return false;
  }

  var parts = seedNode.split(':');
  var hasOnePort = parts.length === 2;

  if (!hasOnePort) {
    return false;
  }

  var port = parts[1];

  if (!port) {
    return false;
  }

  var isPortNumeric = port.match(/[0-9]*/)[0] === port;
  return isPortNumeric;
}
